import React from 'react';
import './App.css';
import Box from './components/Box';
import VerticalDivider from './components/VerticalDivider';

function App() {
  return (
    <div className="page">
      <Box id="box1" />
      <VerticalDivider />
      <Box id="box2" />
      <div id="box2-buttons">
        <button className="left-button"><img src="img/3a.png" alt="Left" /></button>
        <button className="right-button"><img src="img/3b.png" alt="Right" /></button>
      </div>
    </div>
  );
}

export default App;
